import React from 'react';
import {BrowserRouter as Router, Route, Routes} from 'react-router-dom';
import axios from 'axios';

import Navbar from './layouts/frontend/Navbar';

import PublicRoute from './PublicRoute';
import Order from './components/frontend/Order';
import Category from './components/frontend/Category';
import Company from './components/frontend/Company';

axios.defaults.baseURL = "http://127.0.0.1:8000/";

axios.defaults.headers.post['Content-Type'] = 'application/json';
axios.defaults.headers.post['Accept'] = 'application/json';

axios.defaults.withCredentials = true;

axios.interceptors.request.use(function (config) {
  const token = localStorage.getItem('auth_token');
  config.headers.Authorization = token ? `Bearer ${token}` : '';
  return config;
});

function App() {
  return (
    <Router>
      <div className="App">
          <Navbar />
            <Routes>
              <Route path="/" element={<Order/>} /> 
              <Route path="/" element={<Order/>} /> 
              <Route path="/category" element={<Order/>} /> 
              <Route path="/company" element={<Order/>} /> 
            </Routes>
      </div>
    </Router>
  );
}

export default App;
